import React from "react";
import "./Footer.scss";

const Footer = () => {
  return (
    <footer className="footer">
      <a
        href="https://github.com/joaopedrogr" // Substitua pelo link do seu GitHub
        target="_blank"
        rel="noopener noreferrer"
        className="footer-link"
      >
        <img
          src="https://cdn-icons-png.flaticon.com/512/25/25231.png" // Ícone do GitHub
          alt="GitHub"
          className="footer-icon"
        />
      </a>
    </footer>
  );
};

export default Footer;
